import React, { useState } from 'react';
import './RentOutBike.css';
import axios from 'axios';
import { useAuth } from './AuthContext'; // Import useAuth
import { DateRangePicker } from 'react-date-range'; // Import DateRangePicker
import 'react-date-range/dist/styles.css'; // main style file
import 'react-date-range/dist/theme/default.css'; // theme css file


const RentOutBike = ({ navigateTo }) => {
  const [isListingCreated, setListingCreated] = useState(false);
  const [formData, setFormData] = useState({
    vehicleName: '',
    vehicleDescription: '',
    milesDriven: '',
    pricePerDay: '',
    location: '',
    availability: '',
    hasFuel: false,
  });

  const [dateRange, setDateRange] = useState([
    {
      startDate: new Date(),
      endDate: null,
      key: 'selection'
    }
  ]);

  const { isLoggedIn } = useAuth(); // Use the useAuth hook to check if the user is logged in

  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleRentOut = async (e) => {
    e.preventDefault();
    if (!isLoggedIn) {
      alert('You must be logged in to rent out a bike');
      return;
    }

    try {
      const response = await axios.post('http://127.0.0.1:5000/rent-out', formData);
      setListingCreated(true);
    } catch (error) {
      console.error('Error renting out the bike:', error);
      // Handle error (show message to user, etc.)
    }
  };

  return (
    <div className="rent">
      <div className="flex-container1_rob">
        <div className="box-content0_rob">
          <span className="typing-animation1_rob">Rent it Out! </span>
          <br />
          <div className="typing-animation1_rob">
            Make money by renting out your bike when you're not using it.
          </div>
        </div>
      </div>
      <div>
        <form className="toRent" onSubmit={handleRentOut}>
          <label>
            Vehicle Name:
            <input
              type="text"
              name="vehicleName"
              value={formData.vehicleName}
              onChange={handleInputChange}
            />
          </label>
          <br />
          <label>
            Vehicle Description:
            <textarea
              name="vehicleDescription"
              value={formData.vehicleDescription}
              onChange={handleInputChange}
            />
          </label>
          <br />
          <label>
            Miles Driven:
            <input
              type="text"
              name="milesDriven"
              value={formData.milesDriven}
              onChange={handleInputChange}
            />
          </label>
          <br />
          <label>
            Price Per Day:
            <input
              type="text"
              name="pricePerDay"
              value={formData.pricePerDay}
              onChange={handleInputChange}
            />
          </label>
          <br />
          <label>
            Location:
            <input
              type="text"
              name="location"
              value={formData.location}
              onChange={handleInputChange}
            />
          </label>
          <br />
          <label>
            Availability:
            <input
              type="text"
              name="availability"
              value={formData.availability}
              onChange={handleInputChange}
            />
          </label>
          <br />
          <label>
            Has Fuel:
            <input
              type="checkbox"
              name="hasFuel"
              checked={formData.hasFuel}
              onChange={handleInputChange}
            />
          </label>
          <br />
          <button type="submit">Rent Out</button>
        </form>
        <button onClick={() => navigateTo('landing')}>Go Back</button>
      </div>
      {isListingCreated && (
        <div className="success-message">
          Your bike listing has been created successfully.
        </div>
      )}
    </div>
  );
};

export default RentOutBike;
